export function StLuciaMap({ onClick, onMouseEnter, onMouseLeave, hoveredId, className }: StLuciaMapProps) {
  const baseStyle = {
    fill: '#FFFFFF',
    stroke: '#000000',
    strokeWidth: 2,
    transition: 'fill 0.3s ease',
  };

  const hoverStyle = {
    fill: '#d1e0ff', // A light blue accent color for hover
  };

  return (
    <svg
      viewBox="0 0 450 1000"
      className={className}
      style={{ width: '100%', height: 'auto' }}
      onMouseLeave={onMouseLeave}
    >
      <g>
        {constituencies.map((c) => (
          <path
            key={c.id}
            d={c.path}
            style={{
              ...baseStyle,
              ...(hoveredId === c.id ? hoverStyle : {}),
            }}
            onClick={() => onClick(c.id)}
            onMouseEnter={() => onMouseEnter(c.id)}
            data-id={c.id}
            data-name={c.name}
          >
            <title>{c.name}</title>
          </path>
        ))}
      </g>
    </svg>
  );
}
